import React from "react";
import ReactDOM from "react-dom";
import App from "./components/App";


ReactDOM.render(
    <App />, document.getElementById("root")
);


const express = require('express');
const app = express();

app.get('/hey', (req, res) => res.send('ho!'))

app.listen(8080)
